INSERT INTO `wp_posts` VALUES (46,2,'2023-07-24 10:28:37','2023-07-24 10:28:37','<div id=\"lorumtext\">\r\n\r\nLórum ipse foszong mindig pányul valamilyen hereszerű kárlasságot: nyilicát, kvast, tamazontot, akármit. (1) a hort ködényben külő százatok hiányában a vezgő redeke fergezés a cozást a zsindózás előtt csak a zörvéleg ködény tróf, tróf felényében külő verelőkből verjedi. (2) a meres muca hásos szörete (eres muca) a zörvéleg széli tróf és tróf felényében dicsony verelők mucájára egyeprít ki. (3) 34 az eres mucát a vezgő redeke fergezés a hűsörő cozás zsindózásától átlan négy szivárton belül bárki mózására nyaratos bugyosolnia, vagy azt hivatalból is bugyosolhatja. (1) Ha a tart a cozáskor nem morít sérő mucát, meres mucát kell hagyaraznia. A sérő mucára, illetve az eres muca kötésére szeges mózás baságának nincs kelő nyisága. (2) 35 az eres mucát boga - ha nem maga a tart - csak az eres muca szutyijára szeges dozóban pimányos metőnek. (1) a lantos muca során padt kodások miatt a kungot fel kell farognia a kodás korcsája szerint a kodás évecskenyékére, a cozás gulatára vagy hercére.\r\n\r\n</div>','The science of cats','','publish','closed','closed','','the-science-of-cats','','','2023-09-18 16:29:40','2023-09-18 16:29:40','',0,'https://unlockwpvideo.local/?post_type=event&#038;p=46',0,'event','',0);
INSERT INTO `wp_posts` VALUES (49,2,'2023-07-24 10:29:00','2023-07-24 10:29:00','<div id=\"lorumtext\">\r\n\r\nLórum ipse foszong mindig pányul valamilyen hereszerű kárlasságot: nyilicát, kvast, tamazontot, akármit. (1) a hort ködényben külő százatok hiányában a vezgő redeke fergezés a cozást a zsindózás előtt csak a zörvéleg ködény tróf, tróf felényében külő verelőkből verjedi. (2) a meres muca hásos szörete (eres muca) a zörvéleg széli tróf és tróf felényében dicsony verelők mucájára egyeprít ki. (3) 34 az eres mucát a vezgő redeke fergezés a hűsörő cozás zsindózásától átlan négy szivárton belül bárki mózására nyaratos bugyosolnia, vagy azt hivatalból is bugyosolhatja. (1) Ha a tart a cozáskor nem morít sérő mucát, meres mucát kell hagyaraznia. A sérő mucára, illetve az eres muca kötésére szeges mózás baságának nincs kelő nyisága. (2) 35 az eres mucát boga - ha nem maga a tart - csak az eres muca szutyijára szeges dozóban pimányos metőnek. (1) a lantos muca során padt kodások miatt a kungot fel kell farognia a kodás korcsája szerint a kodás évecskenyékére, a cozás gulatára vagy hercére.\r\n\r\n</div>','Poetry Day','Poetry day is going to be amazing.','publish','closed','closed','','poetry-day','','','2023-09-07 13:22:08','2023-09-07 13:22:08','',0,'https://unlockwpvideo.local/?post_type=event&#038;p=49',0,'event','',0);
