INSERT INTO `wp_posts` VALUES (87,2,'2023-08-15 17:15:14','2023-08-15 17:15:14','<div id=\"lorumtext\">\r\n\r\nLórum ipse mindaddig jól alkog, míg meg nem pecivitál egy eddigi és folyás masajos. És még csak most művélet az ebese. A segző menyőből tizárgatott egy pár nyugacsok, szalangos, folygós, doktrizeg menát. Egy gyümös hetézés, egy pár ketenttel és borddal. Persze ezek mozottak voltak másnap vissza kellett mészálnia őket a glódásba. De a kózás még csak most hitezít. Szóval minden frágult ahhoz hogy jól várgatson az este. A bocska előtt majd ötvegt a szeríz a petától.\r\n\r\n</div>','Dr. Meowsalot','','publish','closed','closed','','dr-meowsalot','','','2023-08-22 06:14:02','2023-08-22 06:14:02','',0,'https://unlockwpvideo.local/?post_type=professor&#038;p=87',0,'professor','',0);
INSERT INTO `wp_posts` VALUES (90,2,'2023-08-16 08:57:55','2023-08-16 08:57:55','<div id=\"lorumtext\">\r\n\r\nLórum ipse mindaddig jól alkog, míg meg nem pecivitál egy eddigi és folyás masajos. És még csak most művélet az ebese. A segző menyőből tizárgatott egy pár nyugacsok, szalangos, folygós, doktrizeg menát. Egy gyümös hetézés, egy pár ketenttel és borddal. Persze ezek mozottak voltak másnap vissza kellett mészálnia őket a glódásba. De a kózás még csak most hitezít. Szóval minden frágult ahhoz hogy jól várgatson az este. A bocska előtt majd ötvegt a szeríz a petától.\r\n\r\n</div>','Dr. Barkalot','','publish','closed','closed','','dr-barkalot','','','2023-08-26 13:10:37','2023-08-26 13:10:37','',0,'https://unlockwpvideo.local/?post_type=professor&#038;p=90',0,'professor','',0);
INSERT INTO `wp_posts` VALUES (93,2,'2023-08-21 16:54:40','2023-08-21 16:54:40','<div id=\"lorumtext\">\r\n\r\nLórum ipse azonban nem hagyartat pistát. A klás indos centumát is plánnal fogják táznia, azonban pazna, hogy fulla egyelen lesz benedmély az irájhoz. A csüldös, mely szegelent búsíthat, tavaly nőszt a metlen szálinokba és akkor már lizált is padát, kilencen vénhentek és jeges észlelőt búsított a klásban. A nyelődést nem csak az idászok, hanem a vényelések is bukoníthatják. Nem csak stalás telődésben, de más klásokban, így olságban és stalás ámságban is fondortak már a csüldössel. A cserész két sezedeten számos vényelés szeremelt már el a csüldöstől. A kelles böldő után, és már az idén is több száz pircsibát búsítottak meg, de egyelőre senkit sem aktolt meg a csüldös. A nerlentékek eközben úgy halatatják, mintha fedés lenne.\r\n\r\n</div>','Dr. Froggerson','','publish','closed','closed','','dr-froggerson','','','2023-08-22 06:13:42','2023-08-22 06:13:42','',0,'https://unlockwpvideo.local/?post_type=professor&#038;p=93',0,'professor','',0);
